import React from 'react';
import { useHistory } from "react-router-dom";
let search = window.location.search;
let params = new URLSearchParams(search);
let foo = params.get('query');
export default class Detail extends React.Component<{},any> {
    constructor() {
        super('');
        this.state = {
            contry: []
        };
    }
    componentDidMount() {
        fetch(`https://restcountries.eu/rest/v2/alpha/COL`)
        .then(res => res.json())
        .then(
            (result) => {
            this.setState({
                contry: result
            });
        });
    }
    render() {
        return (
            <div className="container">
                {console.log(foo)}
                <div className="row filters">
                <button >Go Back</button>
                </div>
                <div className="column-4">
                    <img src={this.state.contry.flag} />
                </div>
                <div className="column-8">
                <div className="description">
                    <h2>{this.state.contry.name}</h2>
                    <table>
                        <tr>
                            <td>
                                <h4>Native Name : {this.state.contry.nativeName}<br/>
                                    Population : {this.state.contry.population}<br />
                                    Region : {this.state.contry.region}<br/>
                                    Sub Region : {this.state.contry.subregion}<br/>
                                    Capital : {this.state.contry.capital}</h4>
                            </td>
                        </tr>
                    </table>

                    </div>
                </div>
            </div>
        )
    };
    
}
